// Companion code to the above tables.  Reads and issues
// a series of LCD commands stored in PROGMEM byte array.
void commandList(const uint8_t *addr, uint8_t * const p_tx_data, uint8_t * const p_rx_data) {

  uint8_t i;
  uint8_t cmd_number = *(addr++);
  uint8_t  numArgs;
  uint16_t ms;
  for (i = 0; i < cmd_number; i++) {
    writecommand(*(addr++), p_tx_data, p_rx_data);
    numArgs  = *(addr++);    //   Number of args to follow
    ms       = numArgs & DELAY;          //   If hibit set, delay follows args
    numArgs &= ~DELAY;                   //   Mask out delay bit
    while (numArgs--) {                  //   For each argument...
      writedata(*(addr++), p_tx_data, p_rx_data); //     Read, issue argument
    }
    if (ms) {
      ms = *(addr++); // Read post-command delay time (ms)
      if (ms == 255) ms = 500;    // If 255, delay for 500 ms
      delay(ms);
    }
  }
}

uint32_t  _rs, colstart, rowstart; // some displays need this changed
int32_t   _rst;  // Must use signed type since a -1 sentinel is assigned.

// Initialization code common to both 'B' and 'R' type displays
void commonInit(const uint8_t *cmdList, uint8_t * const p_tx_data, uint8_t * const p_rx_data) {
  colstart  = rowstart = 0; // May be overridden in init func

  pin_mode_output(_rs);

  if (_rst) {
    pin_mode_output(_rst);
    digital_write(_rst, HIGH);
    delay(500);
    digital_write(_rst, LOW);
    delay(500);
    digital_write(_rst, HIGH);
    delay(500);
  }
  if (cmdList) commandList(cmdList, p_tx_data, p_rx_data);
}

// Initialization for ST7735R screens (green or red tabs)
void initR(uint8_t options, uint8_t * const p_tx_data, uint8_t * const p_rx_data) {
  commonInit(Rcmd1, p_tx_data, p_rx_data);
  if (options == INITR_GREENTAB) {
    commandList(Rcmd2green, p_tx_data, p_rx_data);
    colstart = 2;
    rowstart = 1;
  } else if (options == INITR_144GREENTAB) {
    _height = ST7735_TFTHEIGHT_144;
    commandList(Rcmd2green144, p_tx_data, p_rx_data);
    colstart = 2;
    rowstart = 3;
  } else {
    // colstart, rowstart left at default '0' values
    commandList(Rcmd2red, p_tx_data, p_rx_data);
  }
  commandList(Rcmd3, p_tx_data, p_rx_data);

  // if black, change MADCTL color filter
  if (options == INITR_BLACKTAB) {
    writecommand(ST7735_MADCTL, p_tx_data, p_rx_data);
    writedata(0xC0, p_tx_data, p_rx_data);
  }
}

void setAddrWindow(uint8_t x0, uint8_t y0, uint8_t x1,
                   uint8_t y1, uint8_t * const p_tx_data, uint8_t * const p_rx_data) {

  writecommand(ST7735_CASET, p_tx_data, p_rx_data); // Column addr set
  writedata(0x00, p_tx_data, p_rx_data);
  writedata(x0 + colstart, p_tx_data, p_rx_data); // XSTART
  writedata(0x00, p_tx_data, p_rx_data);
  writedata(x1 + colstart, p_tx_data, p_rx_data); // XEND

  writecommand(ST7735_RASET, p_tx_data, p_rx_data); // Row addr set
  writedata(0x00, p_tx_data, p_rx_data);
  writedata(y0 + rowstart, p_tx_data, p_rx_data); // YSTART
  writedata(0x00, p_tx_data, p_rx_data);
  writedata(y1 + rowstart, p_tx_data, p_rx_data); // YEND

  writecommand(ST7735_RAMWR, p_tx_data, p_rx_data); // write to RAM
}

// fill a rectangle
void fillRect(int16_t x, int16_t y, int16_t w, int16_t h,
              uint16_t color, uint8_t * const p_tx_data, uint8_t * const p_rx_data) {

  // rudimentary clipping (drawChar w/big text requires this)
  if ((x >= _width) || (y >= _height)) return;
  if ((x + w - 1) >= _width)  w = _width  - x;
  if ((y + h - 1) >= _height) h = _height - y;

  setAddrWindow(x, y, x + w - 1, y + h - 1, p_tx_data, p_rx_data);

  uint8_t hi = color >> 8, lo = color;

  uint32_t count = 0;
  for (y = h; y > 0; y--) {
    for (x = w; x > 0; x--) {
      if (count == TX_RX_BUF_LENGTH) {
        writedata2(p_tx_data, p_rx_data, count);
        count = 0;
      }
      p_tx_data[count++] = hi;
      p_tx_data[count++] = lo;
    }
  }
  writedata2(p_tx_data, p_rx_data, count);
}

void fillScreen(uint16_t color, uint8_t * const p_tx_data, uint8_t * const p_rx_data) {
  fillRect(0, 0,  _width, _height, color, p_tx_data, p_rx_data);
}

/**@brief ADC interrupt handler.
 * @details  This function will fetch the conversion result from the ADC, convert the value into
 *           percentage and send it to peer.
 */
void ADC_IRQHandler(void)
{
  NRF_ADC->EVENTS_END     = 0;
  uint16_t adc_result              = NRF_ADC->RESULT;
  NRF_ADC->TASKS_STOP     = 1;

  uint8_t old_state = button_state;

  if (button_state == BUTTON_NONE) {
    if (adc_result < 62) button_state = BUTTON_DOWN;
    else if (adc_result < 310) button_state = BUTTON_RIGHT;
    else if (adc_result < 465) button_state = BUTTON_SELECT;
    else if (adc_result < 620) button_state = BUTTON_UP;
    else if (adc_result < 1020) button_state = BUTTON_LEFT;
  }
  else {
    if (adc_result > 1020) button_state = BUTTON_NONE;
  }
  if (old_state != button_state) {
    SEGGER_RTT_printf(0, "\x1B[32mbutton state : %s\x1B[0m\n", BUTTON_STATE_STRING_ENUM[button_state]);
    button_state_change = true;
  }
}

/**
 * @brief Function for initializing bsp module.
 */

void bsp_configuration() {

  uint32_t err_code = NRF_SUCCESS;

  NRF_CLOCK->LFCLKSRC            = (CLOCK_LFCLKSRC_SRC_Xtal << CLOCK_LFCLKSRC_SRC_Pos);
  NRF_CLOCK->EVENTS_LFCLKSTARTED = 0;
  NRF_CLOCK->TASKS_LFCLKSTART    = 1;

  while (NRF_CLOCK->EVENTS_LFCLKSTARTED == 0) {
    // Do nothing.
  }

  APP_TIMER_INIT(APP_TIMER_PRESCALER, APP_TIMER_OP_QUEUE_SIZE, NULL);

  err_code = app_timer_create(&m_adc_sampling_timer_id,
                              APP_TIMER_MODE_REPEATED,
                              adc_sampling_timeout_handler);

  err_code = bsp_init(BSP_INIT_LED, APP_TIMER_TICKS(100, APP_TIMER_PRESCALER), NULL);
  APP_ERROR_CHECK(err_code);
}

void draw_bitmap_st7735(uint16_t pos_x,
                        uint16_t pos_y,
                        const uint16_t *image,
                        uint16_t bitmap_width,
                        uint16_t bitmap_height,
                        uint8_t * const p_tx_data,
                        uint8_t * const p_rx_data) {

  int i = bitmap_width * (bitmap_height - 1);

  setAddrWindow(pos_x, pos_y - bitmap_height + 1, pos_x + bitmap_width - 1, pos_y, p_tx_data, p_rx_data);

  uint32_t count = 0;
  for (uint16_t y = 0; y < bitmap_height; y++) {

    for (uint16_t x = 0; x < bitmap_width; x++) {

      if (count == TX_RX_BUF_LENGTH) {
        writedata2(p_tx_data, p_rx_data, count);
        count = 0;
      }
      p_tx_data[count++] = image[i];
      p_tx_data[count++] = (image[i] >> 8);
      i++;
    }
    i = i - 2 * bitmap_width;
  }
  writedata2(p_tx_data, p_rx_data, count);
}

void draw_bitmap() {
  if (color_index == 0) {
    draw_bitmap_st7735(0, ST7735_TFTHEIGHT_18, imageLogo, ST7735_TFTWIDTH, ST7735_TFTHEIGHT_18, m_tx_data, m_rx_data);
  }
}

/**
 * @brief Function for application main entry. Does not return.
 */
int main(void) {

  // Setup bsp module.
  bsp_configuration();
  buttons_init();
  gpiote_init();
  adc_init();
  application_timers_start();

  _width    = ST7735_TFTWIDTH;
  _height   = ST7735_TFTHEIGHT_18;
  _rs   = TFT_DC;
  _rst  = TFT_RST;

  nrf_drv_spi_config_t const config =
  {
    .sck_pin  = TFT_SCLK,
    .mosi_pin = TFT_MOSI,
    .miso_pin = TFT_MISO,
    .ss_pin   = TFT_CS,
    .irq_priority = APP_IRQ_PRIORITY_LOW,
    .orc          = 0xFF,
    .frequency    = NRF_DRV_SPI_FREQ_8M,
    .mode         = NRF_DRV_SPI_MODE_0,
    .bit_order    = NRF_DRV_SPI_BIT_ORDER_MSB_FIRST,
  };

  ret_code_t err_code = nrf_drv_spi_init(&m_spi_master, &config, NULL);
  APP_ERROR_CHECK(err_code);

  initR(INITR_BLACKTAB, m_tx_data, m_rx_data);
  fillScreen(ST7735_WHITE, m_tx_data, m_rx_data);
  color_index = 0;
  draw_bitmap_st7735(0, ST7735_TFTHEIGHT_18, imageLogo, ST7735_TFTWIDTH, ST7735_TFTHEIGHT_18, m_tx_data, m_rx_data);

  for (;;)
  {
    if (button_state_change) {
      button_state_change = false;
      SEGGER_RTT_printf(0, "\x1B[32mbutton_state_change\x1B[0m\n");
      switch (button_state) {
      case BUTTON_DOWN:
        decrement_color();
        draw_bitmap();
        if (color_index != 0) {
          fillScreen(color_sequence[color_index], m_tx_data, m_rx_data);
        }
        break;
      case BUTTON_RIGHT:
        increment_color();
        draw_bitmap();
        if (color_index != 0) {
          fillScreen(color_sequence[color_index], m_tx_data, m_rx_data);
        }
        break;
      case BUTTON_UP:
        increment_color();
        draw_bitmap();
        if (color_index != 0) {
          fillScreen(color_sequence[color_index], m_tx_data, m_rx_data);
        }
        break;
      case BUTTON_LEFT:
        decrement_color();
        draw_bitmap();
        if (color_index != 0) {
          fillScreen(color_sequence[color_index], m_tx_data, m_rx_data);
        }
        break;
      }
    }
  }
}